// src/Wordle.js

import React, { useState, useEffect } from 'react';
import styled from '@emotion/styled';
import { motion } from 'framer-motion';
import { generateWordSet, evaluateGuess } from './gameLogic';

const WORD_LENGTH = 5;
const MAX_GUESSES = 6;

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  font-family: 'Arial', sans-serif;
`;

const Title = styled.h1`
  font-size: 2.5rem;
  margin-bottom: 1rem;
`;

const Grid = styled.div`
  display: grid;
  grid-template-rows: repeat(${MAX_GUESSES}, 1fr);
  gap: 5px;
  margin-bottom: 1rem;
`;

const Row = styled.div`
  display: grid;
  grid-template-columns: repeat(${WORD_LENGTH}, 1fr);
  gap: 5px;
`;

const Cell = styled(motion.div)`
  width: 50px;
  height: 50px;
  border: 2px solid #ccc;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1.5rem;
  font-weight: bold;
  text-transform: uppercase;
`;

const Keyboard = styled.div`
  display: grid;
  grid-template-rows: repeat(3, 1fr);
  gap: 5px;
`;

const KeyboardRow = styled.div`
  display: flex;
  justify-content: center;
  gap: 5px;
`;

const Key = styled(motion.button)`
  padding: 10px;
  font-size: 1rem;
  font-weight: bold;
  border: none;
  border-radius: 4px;
  background-color: #d3d6da;
  cursor: pointer;

  &:hover {
    background-color: #bbb;
  }
`;

const Wordle = () => {
  const [wordSet, setWordSet] = useState(new Set());
  const [correctWord, setCorrectWord] = useState('');
  const [guesses, setGuesses] = useState(Array(MAX_GUESSES).fill(''));
  const [currentGuess, setCurrentGuess] = useState('');
  const [gameOver, setGameOver] = useState(false);

  useEffect(() => {
    generateWordSet().then(({ wordSet, todaysWord }) => {
      setWordSet(wordSet);
      setCorrectWord(todaysWord);
    });
  }, []);

  const handleKeyPress = (key) => {
    if (gameOver) return;

    if (key === 'ENTER') {
      if (currentGuess.length !== WORD_LENGTH) return;
      if (!wordSet.has(currentGuess.toLowerCase())) {
        alert('Not in word list');
        return;
      }

      const newGuesses = [...guesses];
      newGuesses[guesses.findIndex(guess => guess === '')] = currentGuess;
      setGuesses(newGuesses);
      setCurrentGuess('');

      if (currentGuess === correctWord) {
        setGameOver(true);
        alert('You won!');
      } else if (newGuesses[MAX_GUESSES - 1] !== '') {
        setGameOver(true);
        alert(`Game over! The word was ${correctWord}`);
      }
    } else if (key === 'BACKSPACE') {
      setCurrentGuess(currentGuess.slice(0, -1));
    } else if (currentGuess.length < WORD_LENGTH) {
      setCurrentGuess(currentGuess + key);
    }
  };

  const keyboardLayout = [
    ['Q', 'W', 'E', 'R', 'T', 'Y', 'U', 'I', 'O', 'P'],
    ['A', 'S', 'D', 'F', 'G', 'H', 'J', 'K', 'L'],
    ['ENTER', 'Z', 'X', 'C', 'V', 'B', 'N', 'M', 'BACKSPACE'],
  ];

  return (
    <Container>
      <Title>Wordle Clone</Title>
      <Grid>
        {guesses.map((guess, i) => (
          <Row key={i}>
            {Array.from({ length: WORD_LENGTH }).map((_, j) => (
              <Cell
                key={j}
                initial={{ scale: 1 }}
                animate={{
                  scale: [1, 1.1, 1],
                  rotate: [0, 10, -10, 0],
                  backgroundColor: guess
                    ? evaluateGuess(guess, correctWord)[j] === 'correct'
                      ? '#6aaa64'
                      : evaluateGuess(guess, correctWord)[j] === 'present'
                      ? '#c9b458'
                      : '#787c7e'
                    : '#fff',
                  color: guess ? '#fff' : '#000',
                }}
                transition={{ duration: 0.3 }}
              >
                {guess[j] || (i === guesses.findIndex(g => g === '') ? currentGuess[j] : '')}
              </Cell>
            ))}
          </Row>
        ))}
      </Grid>
      <Keyboard>
        {keyboardLayout.map((row, i) => (
          <KeyboardRow key={i}>
            {row.map((key) => (
              <Key
                key={key}
                onClick={() => handleKeyPress(key)}
                whileTap={{ scale: 0.95 }}
              >
                {key === 'BACKSPACE' ? '⌫' : key}
              </Key>
            ))}
          </KeyboardRow>
        ))}
      </Keyboard>
    </Container>
  );
};

export default Wordle;
